import React from 'react';
import Iso from '../Iso';
import Footer from '../Footer';
import Fsc from '../Fsc';
import Epb from '../Epb';
import Erc from '../Erc';
import Rex from '../Rex';

function Certification() {
  return (
    <>
      <Iso />
      <Fsc />
      <Epb />
      <Erc />
      <Rex />
      <Footer />
    </>
  );
}

export default Certification;
